sys_variable_value.value:
(function execute(inputs, outputs) {
      var responseObject = JSON.parse(inputs.response_body);

  		var name = responseObject.results[0].name;
  		var games = [];
  		for (var i = 0; i <= responseObject.results.length; i++) {
        	games.push(responseObject.result[i]);
        }
  		outputs.name = name;
  		outputs.games = games;

  })(inputs, outputs);

